import React, { useEffect, useState } from "react";
import './propertyCartApi.css';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { Grid } from '@mui/material';

const PropertyCart = () => {

    const [showCart, setShowCart] = useState([]);

    // Show Property Cart
    // const propertyCart = () => {
    //     return (
    //         <>
    //             <div className="">
    //                 {
    //                     showCart.map((item, index) => (
    //                         <div key={index} className='carts'>
    //                             <div className="cart ">
    //                                 <h3>{item.city} </h3>
    //                                 {
    //                                     item.image.map((img, index) => (
    //                                         <div key={index}>
    //                                             <img src={img} alt={item} className='image w-25' ></img>
    //                                             <button className="btn bg-info w-50 my-3">Per sqft : {item.rate} </button>
    //                                         </div>
    //                                     ))
    //                                 }
    //                             </div>
    //                         </div>
    //                     ))
    //                 }
    //             </div>
    //         </>
    //     )
    // }

    const cartImage = (API) => {
        fetch('http://localhost:3333/realestate/cartimage')
            .then(async (res) => {
                const cart = await res.json();
                return cart;
            })
            .then((cart) => {
                console.log("Image data : ", cart.data);
                setShowCart(cart.data);
            })
            .catch((err) => {
                console.log("Cart image: ", err.message);
            })
    }

    const material = () => {
        return (
            <div className="cartD">
                {

                    showCart.map((item, index) => (
                        <div key={index}>
                            <Grid container spacing={2}>
                                <Grid></Grid>
                                <Card sx={{ maxWidth: 345 }}>
                                    {
                                        item.image.map((item, index) => (
                                            <div key={index}>
                                                <CardMedia
                                                    component="img"
                                                    alt="green iguana"
                                                    height="140"
                                                    image={item}
                                                />
                                            </div>
                                        ))
                                    }
                                    <CardContent>
                                        <Typography gutterBottom variant="h5" component="div">
                                            {item.city}
                                        </Typography>
                                        <Typography variant="body2" color="text.secondary">
                                            {item.info}
                                        </Typography>
                                    </CardContent>
                                    <CardActions>
                                        <Button size="small" variant="contained" color="success" >{item.propertyFor} </Button>
                                        <Button size="small" variant="contained" color="primary">{item.type} </Button>
                                    </CardActions>
                                </Card>
                            </Grid>
                        </div>
                    ))
                }
            </div>
        );
    }



    const tryCart = () => {
        return (
            <>
                <div className="cartShow bg-dark">
                    {
                        showCart.map((item, index) => (
                            <div key={index}>
                                {
                                    item.image.map((img, index) => (
                                        <div key={index} className='image'>
                                            <img src={img} alt='No property upload'></img>
                                        </div>
                                    ))
                                }
                            </div>
                        ))
                    }
                </div>
            </>
        )
    }

    useEffect((e) => {
        cartImage();
    }, [])

    return (
        <React.Fragment>
            {/* {propertyCart()} */}
            {/* {tryCart()} */}
            {material()}
        </React.Fragment>
    )
}

export default PropertyCart;
